trong>(<span id=\"Eyes_Other\">0</span>)</strong></span></a></li>\r\n                </ul>\r\n          </div>\r\n     </div>            \r\n            \r\n      <div class=\"row\">\r\n         <div class=\"col-xs-12 col-sm-6 pr0\">\r\n            <p class=\"sc-orangelist-title\"><strong>Hourly Rate of Escort</strong></p>\r\n            <ul class=\"sc-orangelist\">\r\n                <li><a href=\"#\" onclick=\"return multipleSearchAdd('Rate', '0 - 100')\">0 - 100 <span  id=\"Rate_0_-_100_nm\"><strong>(<span id=\"Rate_0_-_100\">0</span>)</strong></span></a></li>\r\n                <li><a href=\"#\" onclick=\"return multipleSearchAdd('Rate', '101 - 200')\">101 - 200 <span  id=\"Rate_101_-_200_nm\"><strong>(<span id=\"Rate_101_-_200\">0</span>)</strong></span></a></li>\r\n                <li><a href=\"#\" onclick=\"return multipleSearchAdd('Rate', '201 - 300')\">201 - 300 <span  id=\"Rate_201_-_300_nm\"><strong>(<span id=\"Rate_201_-_300\">0</span>)</strong></span></a></li>\r\n                <li><a href=\"#\" onclick=\"return multipleSearchAdd('Rate', '301 - 400')\">301 - 400 <span  id=\"Rate_301_-_400_nm\"><strong>(<span id=\"Rate_301_-_400\">0</span>)</strong></span></a></li>\r\n                <li><a href=\"#\" onclick=\"return multipleSearchAdd('Rate', '401 - 500')\">401 - 500 <span  id=\"Rate_401_-_500_nm\"><strong>(<span id=\"Rate_401_-_500\">0</span>)</strong></span></a></li>\r\n                <li><a href=\"#\" onclick=\"return multipleSearchAdd('Rate', '501 plus')\">501 + <span id=\"Rate_501_plus_nm\"><strong>(<span id=\"Rate_501_plus\">0</span>)</strong></span></a></li>\r\n            </ul>\r\n            </div>\r\n         \r\n         \r\n             \r\n         <div class=\"col-xs-12 col-sm-6 pr0\">\r\n           <p class=\"sc-orangelist-title\"><strong>Incall or Outcall Escort</strong></p>\r\n            <ul class=\"sc-orangelist\">\r\n                 <li><a href=\"#\" onclick=\"return multipleSearchAdd('Incall-Outcall', 'Incall')\">Incall <span  id=\"Incall-Outcall_Incall_nm\"> <strong>(<span id=\"Incall-Outcall_Incall\">0</span>)</strong></span></a></li>\r\n        <li><a href=\"#\" onclick=\"return multipleSearchAdd('Incall-Outcall', 'Outcall')\">Outcall <span  id=\"Incall-Outcall_Outcall_nm\"><strong>(<span id=\"Incall-Outcall_Outcall\">0</span>)</strong></span></a></li>\r\n        <!--<li><a style=\"cursor:pointer;\" onclick=\"return multipleSearchAdd('Incall-Outcall', 'Both')\"><span class=\"nobold\" id=\"Incall-Outcall_Both_nm\">Both</span> (<span id=\"Incall-Outcall_Both\">26</span>)</a></li>-->\r\n            </ul>\r\n         </div>\r\n               </div>            \r\n       \r\n           <br />\r\n    Open links in new window\r\n    <input type=\"checkbox\" id=\"open_links_in_new_window\">\r\n</div>\r\n<script type=\"text/javascript\">\r\n    //<![CDATA[\r\n    //page one shown by default\r\n    page = 1;\r\n    //set the array used for multiple search\r\n    var multiple_search = new Array();\r\n    function store_url_search_vars(name, value) {\r\n        //stores search values in the url and adds them to the JS search filter\r\n        multiple_search[name] = value;\r\n        value = value.replace(\" \", \"_\");\r\n        value = value.replace(\" \", \"_\");\r\n        value = value.replace(\"<\", \"lt\");\r\n        value = value.replace(\"+\", \"plus\");\r\n        value = value.replace(\"__\", \"_plus\");\r\n        if((name!=\"Incall/Outcall\") && (name != '')) {\r\n            document.getElementById(name + \"_\" + value + \"_nm\").style.color = '#ff4b01';\r\n        }\r\n    }\r\n     \r\n\r\n    function SearchRemove(name, value, dontComplete) {\r\n        //removes the new filter from the JS array\r\n        delete multiple_search[name];\r\n\t\r\n        //remove highlight on the option\r\n        value = value.replace(\" \", \"_\");\r\n        value = value.replace(\" \", \"_\");\r\n\t\r\n        name = name.replace(\"Incall/Outcall\", \"Incall-Outcall\");\r\n        value = value.replace(\"<\", \"lt\");\r\n        value = value.replace(\"+\", \"plus\");\r\n        document.getElementById(name + \"_\" + value + \"_nm\").style.color = 'black';\r\n\t\r\n        if(dontComplete==\"\") {\r\n            search_updateOther(multiple_search,'second_loading');\r\n        }\r\n    }\r\n\r\n    function multipleSearchAdd(name, value) {\r\n        //adds a value to the multiple search (and then performs the actual Ajax search to return and display the results)\r\n        $('.list_escort_extra').html('');\r\n        document.getElementById('search_filter').style.display = 'block';\r\n        if(multiple_search[name] == value) {\r\n            SearchRemove(name, value, \"\");\r\n            return;\r\n        }\r\n        //current value\r\n        if(multiple_search[name]) {\r\n            curr_val = multiple_search[name];\r\n            //remove the currently selected value\r\n            SearchRemove(name, curr_val, 1);\r\n        }\r\n        //add new details\r\n        multiple_search[name] = value;\r\n\t\t\t\r\n        //highlight the option\r\n        value = value.replace(\" \", \"_\");\r\n        value = value.replace(\" \", \"_\");\r\n        document.getElementById(name + \"_\" + value + \"_nm\").style.color = '#ff4b01';\r\n        search_updateOther(multiple_search,'second_loading');\r\n    }\r\n\r\n    function search_updateOther(multiple_search,loading) {\r\n        //create an array of the exisiting values that can be sent using Ajax\r\n        query_string = \"\";\r\n\t\r\n        for (var i in multiple_search) {\r\n            name = i;\r\n            value = multiple_search[i];\r\n            name = name.replace(/Incall-Outcall/g, \"Incall/Outcall\");\r\n            value = value.replace(/lt/g, \"<\");\r\n            value = value.replace(/plus/g, \"+\");\r\n            query_string += name + '=' + value + \"&\";\r\n        }\r\n        //perform the actual search and display results using the existing array values\r\n        if (loading == 'second_loading'){\r\n           AjaxAction(2, query_string);\r\n        }   \r\n//        console.log('search_updateOther');\r\n\r\n//perform each Ajax action on each of the search options (using the above prepared array and adding a new array for each of the options as we perform the search)\r\nfor (i=0; i<=46; i=i+1) {\r\n    name=\"\";\r\n    value=\"\"\r\n    switch(i) {\r\n        case 0:\r\n            name = \"Sex\";\r\n            value = \"Male\";\r\n            break;\r\n        case 1:\r\n            name = \"Sex\";\r\n            value = \"Female\";\r\n            break;\r\n        case 2:\r\n            name = \"Sex\";\r\n            value = \"Transgender\";\r\n            break;\r\n        case 3:\r\n            name = \"Hair\";\r\n            value = \"Black\";\r\n            break;\r\n        case 4:\r\n            name = \"Hair\";\r\n            value = \"Blonde\";\r\n            break;\r\n        case 5:\r\n            name = \"Hair\";\r\n            value = \"Brunette\";\r\n            break;\r\n        case 6:\r\n            name = \"Hair\";\r\n            value = \"Other\";\r\n            break;\r\n        case 7:\r\n            name = \"Height\";\r\n            value = \"< 5\";\r\n            break;\r\n        case 8:\r\n            name = \"Height\";\r\n            value = \"5.1 - 5.5\";\r\n            break;\r\n        case 9:\r\n            name = \"Height\";\r\n            value = \"5.6 - 6.0\";\r\n            break;\r\n        case 10:\r\n            name = \"Height\";\r\n            value = \"6.1 +\";\r\n            break;\r\n        case 11:\r\n            name = \"Rate\";\r\n            value = \"0 - 100\";\r\n            break;\r\n        case 12:\r\n            name = \"Rate\";\r\n            value = \"101 - 200\";\r\n            break;\r\n        case 13:\r\n            name = \"Rate\";\r\n            value = \"201 - 300\";\r\n            break;\r\n        case 14:\r\n            name = \"Rate\";\r\n            value = \"301 - 400\";\r\n            break;\r\n        case 15:\r\n            name = \"Rate\";\r\n            value = \"401 - 500\";\r\n            break;\r\n        case 16:\r\n            name = \"Rate\";\r\n            value = \"501 +\";\r\n            break;\r\n        case 17:\r\n            name = \"Eyes\";\r\n            value = \"Black\";\r\n            break;\r\n        case 18:\r\n            name = \"Eyes\";\r\n            value = \"Brown\";\r\n            break;\r\n        case 19:\r\n            name = \"Eyes\";\r\n            value = \"Blue\";\r\n            break;\r\n        case 20:\r\n            name = \"Eyes\";\r\n            value = \"Green\";\r\n            break;\r\n        case 21:\r\n            name = \"Weight\";\r\n            value = \"< 100lbs\";\r\n            break;\r\n        case 22:\r\n            name = \"Weight\";\r\n            value = \"101lbs - 120lbs\";\r\n            break;\r\n        case 23:\r\n            name = \"Weight\";\r\n            value = \"121lbs - 140lbs\";\r\n            break;\r\n        case 24:\r\n            name = \"Weight\";\r\n            value = \"141lbs +\";\r\n            break;\r\n        case 25:\r\n            name = \"Incall/Outcall\";\r\n            value = \"Incall\";\r\n            break;\r\n        case 26:\r\n            name = \"Incall/Outcall\";\r\n            value = \"Outcall\";\r\n            break;\r\n        case 27:\r\n            name = \"Incall/Outcall\";\r\n            value = \"Both\";\r\n            break;\r\n        case 28:\r\n            name = \"Age\";\r\n            value = \"18 - 20\";\r\n            break;\r\n        case 29:\r\n            name = \"Age\";\r\n            value = \"21 - 25\";\r\n            break;\r\n        case 30:\r\n            name = \"Age\";\r\n            value = \"26 - 30\";\r\n            break;\r\n        case 31:\r\n            name = \"Age\";\r\n            value = \"31 - 40\";\r\n            break;\r\n        case 32:\r\n            name = \"Age\";\r\n            value = \"41 +\";\r\n            break;\r\n        case 33:\r\n            name = \"Hair\";\r\n            value = \"Redhead\";\r\n            break;\r\n        case 34:\r\n            name = \"Eyes\";\r\n            value = \"Dark Brown\";\r\n            break;\r\n        case 35:\r\n            name = \"Eyes\";\r\n            value = \"Hazel\";\r\n            break;\r\n        case 36:\r\n            name = \"Eyes\";\r\n            value = \"Gray\";\r\n            break;\r\n        case 37:\r\n            name = \"Eyes\";\r\n            value = \"Other\";\r\n            break;\r\ncase 38:name = \"Ethnicity\";value = \"Asian\";break;case 39:name = \"Ethnicity\";value = \"Black\";break;case 40:name = \"Ethnicity\";value = \"Caucasian\";break;case 41:name = \"Ethnicity\";value = \"Eastern European\";break;case 42:name = \"Ethnicity\";value = \"Hispanic\";break;case 43:name = \"Ethnicity\";value = \"Indian\";break;case 44:name = \"Ethnicity\";value = \"Middle Eastern\";break;case 45:name = \"Ethnicity\";value = \"Mixed\";break;case 46:name = \"Ethnicity\";value = \"Native American\";break;    }\r\n            if(name!=\"\" && value!=\"\") {\r\n                //remove this item from the query string (if it exists)\r\n                query_string_without_current = query_string.replace(name + \"=\", \"x=\");\r\n                query_string_without_current += name + '=' + value;\r\n                AjaxAction(1, query_string_without_current, name, value);\r\n            }\r\n        }\r\n\r\n        //update the display bar\r\n        if(multiple_search) {\r\n            displaySearchSelections(multiple_search);\r\n        }\r\n    }\r\n\r\n    \r\n    function show_more_search(show_start) {\r\n        //create an array of the exisiting values that can be sent using Ajax\r\n        query_string = \"\";\r\n        if(show_start==1) {\r\n            page = 0;\r\n        }\r\n\r\n        for(var i in multiple_search) {\r\n            name = i;\r\n            value = multi