 value, dontComplete) {\r\n        //removes the new filter from the JS array\r\n        delete multiple_search[name];\r\n\t\r\n        //remove highlight on the option\r\n        value = value.replace(\" \", \"_\");\r\n        value = value.replace(\" \", \"_\");\r\n\t\r\n        name = name.replace(\"Incall/Outcall\", \"Incall-Outcall\");\r\n        value = value.replace(\"<\", \"lt\");\r\n        value = value.replace(\"+\", \"plus\");\r\n        document.getElementById(name + \"_\" + value + \"_nm\").style.color = 'black';\r\n\t\r\n        if(dontComplete==\"\") {\r\n            search_updateOther(multiple_search,'second_loading');\r\n        }\r\n    }\r\n\r\n    function multipleSearchAdd(name, value) {\r\n        //adds a value to the multiple search (and then performs the actual Ajax search to return and display the results)\r\n        $('.list_escort_extra').html('');\r\n        document.getElementById('search_filter').style.display = 'block';\r\n        if(multiple_search[name] == value) {\r\n            SearchRemove(name, value, \"\");\r\n            return;\r\n        }\r\n        //current value\r\n        if(multiple_search[name]) {\r\n            curr_val = multiple_search[name];\r\n            //remove the currently selected value\r\n            SearchRemove(name, curr_val, 1);\r\n        }\r\n        //add new details\r\n        multiple_search[name] = value;\r\n\t\t\t\r\n        //highlight the option\r\n        value = value.replace(\" \", \"_\");\r\n        value = value.replace(\" \", \"_\");\r\n        document.getElementById(name + \"_\" + value + \"_nm\").style.color = '#ff4b01';\r\n        search_updateOther(multiple_search,'second_loading');\r\n    }\r\n\r\n    function search_updateOther(multiple_search,loading) {\r\n        //create an array of the exisiting values that can be sent using Ajax\r\n        query_string = \"\";\r\n\t\r\n        for (var i in multiple_search) {\r\n            name = i;\r\n            value = multiple_search[i];\r\n            name = name.replace(/Incall-Outcall/g, \"Incall/Outcall\");\r\n            value = value.replace(/lt/g, \"<\");\r\n            value = value.replace(/plus/g, \"+\");\r\n            query_string += name + '=' + value + \"&\";\r\n        }\r\n        //perform the actual search and display results using the existing array values\r\n        if (loading == 'second_loading'){\r\n           AjaxAction(2, query_string);\r\n        }   \r\n//        console.log('search_updateOther');\r\n\r\n//perform each Ajax action on each of the search options (using the above prepared array and adding a new array for each of the options as we perform the search)\r\nfor (i=0; i<=46; i=i+1) {\r\n    name=\"\";\r\n    value=\"\"\r\n    switch(i) {\r\n        case 0:\r\n            name = \"Sex\";\r\n            value = \"Male\";\r\n            break;\r\n        case 1:\r\n            name = \"Sex\";\r\n            value = \"Female\";\r\n            break;\r\n        case 2:\r\n            name = \"Sex\";\r\n            value = \"Transgender\";\r\n            break;\r\n        case 3:\r\n            name = \"Hair\";\r\n            value = \"Black\";\r\n            break;\r\n        case 4:\r\n            name = \"Hair\";\r\n            value = \"Blonde\";\r\n            break;\r\n        case 5:\r\n            name = \"Hair\";\r\n            value = \"Brunette\";\r\n            break;\r\n        case 6:\r\n            name = \"Hair\";\r\n            value = \"Other\";\r\n            break;\r\n        case 7:\r\n            name = \"Height\";\r\n            value = \"< 5\";\r\n            break;\r\n        case 8:\r\n            name = \"Height\";\r\n            value = \"5.1 - 5.5\";\r\n            break;\r\n        case 9:\r\n            name = \"Height\";\r\n            value = \"5.6 - 6.0\";\r\n            break;\r\n        case 10:\r\n            name = \"Height\";\r\n            value = \"6.1 +\";\r\n            break;\r\n        case 11:\r\n            name = \"Rate\"